import React from "react";


const Curses = ({curses}) => {
    return (
        <div>
            {curses.map(c => 
                <div>
                    <ul>
                        <li>
                            <h1>{c.name_curses}</h1>
                            Номер курса: <p>{c.num_curses}</p>
                            <div>
                                Записаны на курс: {c.student.map(s => 
                                    <li>{s.name}</li>
                                    )}
                            </div>

                        </li>
                    </ul>
                </div>
                )}
        </div>
    )
}


export default Curses;
